  false,\n\t\"url\": null,\n\t\"notes\": \"A Group for High Resolution Sea Surface
  Temperature (GHRSST) global Level 4 sea surface temperature analysis produced daily
  on a 0.25 degree grid at Remote Sensing Systems. This product uses optimal interpolation
  (OI) from microwave (MW) sensors including the NASA Advanced Microwave Scanning
  Radiometer-EOS (AMSRE), the Tropical Rainfall Measuring Mission Microwave Imager
  (TMI), the Advanced Microwave Scanning Radiometer 2 (AMSR2) onboard the GCOM-W1
  satellite, and WindSat operates on the Coriolis satellite. The through-cloud capabilities
  of microwave radiometers provide a valuable picture of global sea surface temperature
  (SST). This analysis does not use any in situ SST data such as drifting buoy SST.\",\n\t\"license_title\":
